def insert_after_character(string):
    return string.replace(' ', ' W')

print(insert_after_character('Hello world! This is a test.'))  # Output: Hello Wworld! WThis Wis Wa Wtest.
```
Note that the function `replace()` is used to replace all occurrences of a character with another character. In this case, we are replacing all occurrences of `' '` with `' W'`.
